import React, { useContext }  from 'react';
import { RootStoreContext } from '../../store/rootStore';
import { observer } from "mobx-react";
import { toJS } from 'mobx';



const Header = observer(() => {
  const rootStore = useContext(RootStoreContext);
  const data = toJS(rootStore);
  console.log(data.userInfo);

  const checkRenderUserAction = () => {
    var HTMLUserAction = ''
    if (!data.userInfo) {
        HTMLUserAction = 
        <div className='flex gap-10 justify-end items-center'>
            <a href="/login">
                <p className='font-mono text-[blue] font-bold text-[24px] transition-all mb-1 du hover:text-[darkblue]'>
                    Login
                </p>
            </a>
            <a href="/register">
                <button
                    className=" font-mono text-[blue] font-bold text-[24px]"
                    type="button"
                >
                Register
              </button>
            </a>
        </div>
    }
    return HTMLUserAction;
  }

  return (
    <div className='w-screen fixed z-50 h-[80px] bg-white top-0'>
        <div className='w-full flex justify-between py-1 px-[40px] h-full items-center'>
            <div>
                <div className=" animate-charcter-logo flex flex-col">
                  <p className="self-start text-[20px]">Funny</p>
                  <p className="self-start pl-[50px] text-[20px]">movies</p>
                </div>
            </div>
            <div>
               {checkRenderUserAction()}
            </div>
        </div>
    </div>
  );
});

export default Header;
